import { useEffect } from 'react';
import { connect } from 'react-redux';
import { compose } from 'redux';
import './App.css';
import logo from './logo.svg';
import { getConfigState } from './redux/config-reducer';
import { getDataState } from './redux/data-reducer';
import { getGameState } from './redux/gameState-reducer';

const App = (props) => {
  useEffect(() => {
    props.getConfigState();
  }, []);
  useEffect((props) => {
    props.getDataState();
  }, []);
  useEffect((props) => {
    props.getGameState();
  }, []);
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

const mapStateToProps = (state) => ({
  config: state.config,
  data: state.data,
  gameState: state.currentState
})

export default compose(connect(mapStateToProps, { getConfigState, getDataState, getGameState }))(App)
